import React, { useState } from "react";
import "./Profile.css";

// Import all wellness tools
import Breathing from "./Breathing";
import Games from "./Games";
import Journal from "./Journal";
import Sleep from "./Sleep";
import Shop from "./Shop";
import Report from "./Report";
import AICoach from "./AICoach";
import Meditation from "./Meditation";

// ‚úÖ Premium Plans (6-plan structure reused)
const PremiumPlans = ({ user, onUpdateUser }) => {
  const [selectedPlan, setSelectedPlan] = useState(null);

  const plans = [
    {
      id: "weekly",
      name: "Starter Pass",
      price: "‚Çπ99",
      period: "/week",
      description: "A low-risk trial of all premium features.",
      features: ["Full access for 7 days", "Mindful Games", "AI Coach"],
    },
    {
      id: "monthly",
      name: "Monthly Plus",
      price: "‚Çπ299",
      period: "/month",
      description: "Full access with monthly flexibility.",
      features: ["Everything in Starter", "Cancel Anytime", "Priority Support"],
    },
    {
      id: "quarterly",
      name: "Quarterly Pro",
      price: "‚Çπ749",
      period: "/3 months",
      description: "A balanced option for committed users.",
      features: [
        "Everything in Monthly",
        "Save over 15%",
        "Extended feature trials",
      ],
      savings: "Save 16%",
    },
    {
      id: "annual",
      name: "Annual Premium",
      price: "‚Çπ1,999",
      period: "/year",
      description: "Our best value for dedicated users.",
      features: [
        "Everything in Quarterly",
        "Exclusive Themes & Avatars",
        "Early Access",
      ],
      savings: "Save 44%",
    },
    {
      id: "student",
      name: "Student Annual",
      price: "‚Çπ999",
      period: "/year",
      description: "Accessible wellness for students.",
      features: [
        "All Annual Premium features",
        "Requires Student Verification",
      ],
      savings: "50% Off",
    },
    {
      id: "lifetime",
      name: "Elite Lifetime",
      price: "‚Çπ4,999",
      period: "one-time",
      description: "Pay once, own forever.",
      features: ["Everything in Annual", "Exclusive Founder Badge"],
    },
  ];

  const handleSubscribe = (planId) => {
    onUpdateUser({ ...user, plan: planId, is_premium: 1 });
    alert(`üéâ Subscribed to ${planId} successfully!`);
  };

  return (
    <div className="premium-section">
      <h3>‚ú® Upgrade to Premium</h3>
      <div className="plans-container">
        {plans.map((plan) => (
          <div
            key={plan.id}
            className={`plan-card ${selectedPlan === plan.id ? "selected" : ""}`}
            onClick={() => setSelectedPlan(plan.id)}
          >
            <h4>{plan.name}</h4>
            <div className="price">
              <span>{plan.price}</span>
              <span>{plan.period}</span>
            </div>
            {plan.savings && <div className="savings">{plan.savings}</div>}
            <p>{plan.description}</p>
            <ul>
              {plan.features.map((f, idx) => (
                <li key={idx}>‚úì {f}</li>
              ))}
            </ul>
            <button onClick={() => handleSubscribe(plan.id)}>
              {selectedPlan === plan.id ? "‚úì Selected" : "Choose Plan"}
            </button>
          </div>
        ))}
      </div>
    </div>
  );
};

// ‚úÖ Main Profile Component
function Profile({ user, onUpdateUser }) {
  const [activeTool, setActiveTool] = useState(null);

  return (
    <div className="profile-container">
      {!activeTool && (
        <>
          <h2>üë§ Your Profile</h2>
          <p>
            <strong>Username:</strong> {user?.username}
          </p>
          <p>
            <strong>Email:</strong> {user?.email}
          </p>
          <p>
            <strong>Current Plan:</strong> {user?.plan || "Free"}
          </p>

          {/* Quick Actions */}
          <h3>‚ö° Quick Actions</h3>
          <div className="actions-grid">
            <button className="action-btn" onClick={() => setActiveTool("report")}>
              üìä Reports
            </button>
            <button className="action-btn" onClick={() => setActiveTool("ai")}>
              ü§ñ AI Coach
            </button>
            <button className="action-btn" onClick={() => setActiveTool("games")}>
              üéÆ Games
            </button>
            <button className="action-btn" onClick={() => setActiveTool("breathing")}>
              üå¨Ô∏è Breathe
            </button>
            <button className="action-btn" onClick={() => setActiveTool("shop")}>
              üõí Shop
            </button>
            <button className="action-btn" onClick={() => setActiveTool("meditation")}>
              üßò Meditation
            </button>
            <button className="action-btn" onClick={() => setActiveTool("sleep")}>
              üåô Sleep
            </button>
            <button className="action-btn" onClick={() => setActiveTool("journal")}>
              üìî Journal
            </button>
          </div>

          {/* Premium Section */}
          {!user.is_premium && (
            <PremiumPlans user={user} onUpdateUser={onUpdateUser} />
          )}
        </>
      )}

      {/* Render Tools */}
      {activeTool === "report" && (
        <div className="tool-wrapper">
          <button onClick={() => setActiveTool(null)}>‚¨Ö Back</button>
          <Report />
        </div>
      )}
      {activeTool === "ai" && (
        <div className="tool-wrapper">
          <button onClick={() => setActiveTool(null)}>‚¨Ö Back</button>
          <AICoach />
        </div>
      )}
      {activeTool === "games" && (
        <div className="tool-wrapper">
          <button onClick={() => setActiveTool(null)}>‚¨Ö Back</button>
          <Games />
        </div>
      )}
      {activeTool === "breathing" && (
        <div className="tool-wrapper">
          <button onClick={() => setActiveTool(null)}>‚¨Ö Back</button>
          <Breathing />
        </div>
      )}
      {activeTool === "shop" && (
        <div className="tool-wrapper">
          <button onClick={() => setActiveTool(null)}>‚¨Ö Back</button>
          <Shop />
        </div>
      )}
      {activeTool === "meditation" && (
        <div className="tool-wrapper">
          <button onClick={() => setActiveTool(null)}>‚¨Ö Back</button>
          <Meditation />
        </div>
      )}
      {activeTool === "sleep" && (
        <div className="tool-wrapper">
          <button onClick={() => setActiveTool(null)}>‚¨Ö Back</button>
          <Sleep />
        </div>
      )}
      {activeTool === "journal" && (
        <div className="tool-wrapper">
          <button onClick={() => setActiveTool(null)}>‚¨Ö Back</button>
          <Journal />
        </div>
      )}
    </div>
  );
}

export default Profile;
